def test_merged_rsi():
    prev_rsi = None
    prev_candle = None
    for candle in CANDLES:
        merged = merge_candles(candle, Timeframe._15m, prev_candle=prev_candle)
        rsi = calculate_rsi(merged, prev_rsi)
        prev_rsi = rsi
        prev_candle = merged
    assert rsi.value == 64.39
